import Main from "./main";
import Header from "./header";
import InfoStats from "./infoStats";
import './css/infoStats.css'

   function App() {
  return (
    <div className="App">



           <Header/>



        <div className="map_stats">
            <InfoStats title = "Health" total = '23,234,34' count = "345,34,534"/>


            <InfoStats title = "Cases" total = '23,234,34' count = "345,34,534"/>

        <InfoStats title = "Recorved" total = '78,12,65' count = "671,54,890"/>

        <InfoStats title = "Deaths" total = '56,34,45' count = "123,321,345"/>
        </div>





    </div>
  );
}

export default App;
